pragma solidity >=0.7.0 <0.9.0;

contract Callee {
    // 收到 EHT 的事件，記錄 sender & amount
    event Log(address indexed sender, address indexed txOrigin);

    // receive 方法，接收 ETH 時被觸發
    function getMsg() external returns(string memory) {
        emit Log(msg.sender, tx.origin);
        return "called";
    }
}

